import React from "react";

let styles = {
  text: {
    color: "white", 
    fontSize: 25
  }, 
  background: {
    background: "purple"
  }, 
  left: {
    float: left
  }
}

const NavBar = () => {
  return <div className="navbar navbar-light bg-light" style={styles.background}>
    <div className="navbar brand" href="#" style={styles.text}>Clicky Game</div>
    <div className="navbar-text" style={styles.text}>Score</div>
  </div>  
};

export default NavBar;
